/************************************************
 * @brief : Zbar测试函数
 * @param  raw   二维码图像指针           
 * @param  width   图像的宽         
 * @param  height  图像的高        
 * @return int              
 * @date : 2024-05-18
*************************************************/
int Zbar_Test(void *raw, int width, int height)
{

    zbar_image_scanner_t *scanner = NULL;
    /* create a reader */
    scanner = zbar_image_scanner_create();

    /* configure the reader */
    zbar_image_scanner_set_config(scanner, 64, ZBAR_CFG_ENABLE, 1);

    /* wrap image data */
    zbar_image_t *image = zbar_image_create();
    zbar_image_set_format(image, *(int *)"Y800");
    zbar_image_set_size(image, width, height);
    zbar_image_set_data(image, raw, width * height, zbar_image_free_data);

    /* scan the image for barcodes */
    int n = zbar_scan_image(scanner, image);
    printf("n = %d\r\n", n);
    /* extract results */
    const zbar_symbol_t *symbol = zbar_image_first_symbol(image);
    for (; symbol; symbol = zbar_symbol_next(symbol))
    {
        /* do something useful with results */
        zbar_symbol_type_t typ = zbar_symbol_get_type(symbol);
        const char *data = zbar_symbol_get_data(symbol);
        printf("\r\ndecoded %s symbol \"%s\"\r\n",
               zbar_get_symbol_name(typ), data);
    }

    /* clean up */
    zbar_image_destroy(image);
    zbar_image_scanner_destroy(scanner);

    return (0);
}

int main(void)
{

    systick_config();
    usart_gpio_config(9600);
    dma_config();
    printf("ok\n");
    Zbar_Test((void *)gImage_123, 200, 200);

    while (1)
    {
        //        printf("GD32F450ZI-mbed board print\r\n");
        if (g_recv_complete_flag)
        {
            g_recv_complete_flag = 0;
            printf("字节长度:%d ", g_recv_length);
            printf("内容:%s\r\n", g_recv_buff);
            memset(g_recv_buff, 0, g_recv_length);
            g_recv_length = 0;
        }
    }
}

